export default {
    saveUser: Joi.object({
        email: Joi.string().email().required(),
        username: Joi.string().min(4).required(),
        password: Joi.string().min(6).required(),
    }),

    updateUser: Joi.object({
        username: Joi.string().min(4).optional(),
    }),

