import express from 'express';
import * as controller from '../../../controllers/user/user.controller';
import {isAuthenticated} from '../../../middlewares/authenticate';
import validate from '../../../../config/joi.validate';
import schema from '../../../utils/validators/user/validator.user';
import {roleAccess} from "../../../middlewares/roleAuth";

const router = express.Router();

router.route('/')
    .get(isAuthenticated, roleAccess('user'), (req, res) => {
        controller.find(req, res);
    })

    .patch(isAuthenticated, roleAccess('user'), validate(schema.updateUser), (req, res) => {
        controller.update(req, res);
    })

router.route('/inventory')
    .get(isAuthenticated, roleAccess('user'), (req, res) => {
        controller.getInventory(req, res);
    })

    .post(isAuthenticated, roleAccess('user'), (req, res) => {
        controller.addInventoryItem(req, res);
    })

export default router;

