import {StatusCodes} from 'http-status-codes';
import User from '../../models/users/user.model';
import {Inventory} from "../../models/inventory/inventory.model";
import logger from "../../../config/winston";
import * as helper from "../../utils/helpers/errors.helper";
import bcrypt from "bcrypt";
import {checkUsername} from "../users/users.controller"
import Bot from "../../models/bots/bot.model";
import BotRenewal from "../../models/bots/bot_renewal.model";

/**
 * @param {object} req
 * @param {object} res
 * @returns {*}
 */
export async function find(req, res) {
    try {
        const user = await User.forge().where({id: req.currentUser.get('id')}).fetch({require: false});
        if (!user) return await helper.notFound(res, `User not found.`);

        return res.json(user);
    } catch (err) {
        logger.log('error', err);
        return res.status(err.code || StatusCodes.INTERNAL_SERVER_ERROR)
            .json({error: {message: err.message || 'Internal server error.'}});
    }
}

/**
 * @param {object} req
 * @param {object} res
 * @returns {*}
 */
export async function update(req, res) {
    let {username, old_password, new_password, new_password_check} = req.body;
    let userData = {};
    try {
        const user = await User.where({id: req.currentUser.get('id')}).fetch({require: false})
        if (!user) return await helper.notFound(res, 'User not found.');

        if (username !== req.currentUser.get('username')) {
            const usernameExists = await checkUsername(username);
            if (usernameExists) return await helper.badRequest(res, 'Username already exists.');
            userData.username = username;
        }

        if (old_password && new_password && new_password_check) {
            const validPassword = bcrypt.compareSync(old_password, user.get('password'));
            if (!validPassword) return await helper.unauthorized(res, 'Invalid old password.');

            if (new_password === old_password) return await helper.badRequest(res, 'New password is same as previous password.');

            const validPasswordCheck = new_password === new_password_check;
            if (!validPasswordCheck) return await helper.unauthorized(res, 'New passwords does not match.');

            userData.password = bcrypt.hashSync(new_password, 10);
        }

        const updatedUser = await user.save(userData);
        return res.json(updatedUser ? updatedUser.toJSON() : null);
    } catch (err) {
        logger.log('error', err);
        return res.status(err.code || StatusCodes.INTERNAL_SERVER_ERROR)
            .json({error: {message: err.message || 'Internal server error.'}});
    }
}

/**
 * @param {object} req
 * @param {object} res
 * @returns {*}
 */
export async function getInventory(req, res) {
    try {
        const inventory = await Inventory.forge()
            .where({user_id: req.currentUser.get('id')})
            .fetchAll({withRelated: ['purchase', 'sale', 'rentals', 'trade_in', 'trade_out']});

        return res.json(inventory);
    } catch (err) {
        logger.log('error', err);
        return res.status(err.code || StatusCodes.INTERNAL_SERVER_ERROR)
            .json({error: {message: err.message || 'Internal server error.'}});
    }
}

/**
 * @param {object} req
 * @param {object} res
 * @returns {*}
 */
export async function addInventoryItem(req, res) {
    let {bot_id, renewal_type, renewal, purchase, license, accounts} = req.body;
    try {
        const bot = await Bot.where({id: bot_id}).fetch({require: false})
        if (!bot) return await helper.notFound(res, 'Selected bot not found.');

        let newRenewal;
        if (renewal_type === 'lifetime') {
            let data = {bot_id: bot_id, price: 0, period: 0};
            try {
                newRenewal = await BotRenewal.where(data).fetch({require: false});
                if (!newRenewal) {
                    newRenewal = await BotRenewal.forge(data).save();
                }
            } catch (err) {
                logger.log('error', err);
            }
        }
        if (renewal_type === 'renewal') {
            if (renewal.renewal_id) {
                newRenewal = await BotRenewal.forge().where({id: renewal.renewal_id, bot_id}).fetch({require: false});
                if (!newRenewal) return await helper.notFound(res, `Selected renewal for '${bot.get('name')}' not found.`);
            } else {
                let data = {bot_id: bot_id, price: renewal.price, period: renewal.period, currency: renewal.currency};
                try {
                    newRenewal = await BotRenewal.where(data).fetch({require: false});
                    if (!newRenewal) {
                        newRenewal = await BotRenewal.forge(data).save();
                    }
                } catch (err) {
                    logger.log('error', err);
                }
            }
        }

        let inventoryData = {
            bot_id,
            bot_renewal: newRenewal.get('id'),
            user_id: req.currentUser.get('id'),
            renewal_expiry: renewal.hasOwnProperty('expiry') ? renewal.expiry : null,
            active: 1,
            sold: 0
        };
        const inventory = Inventory.forge(inventoryData).save();

        let purchaseData = {
            inventory_item: inventory.get('id'),
            user_id: req.currentUser.get('id'),
            price: purchase.price,
            currency: purchase.currency,
            purchase_date: purchase.date
        }



        // return res.json(inventory);
    } catch (err) {
        logger.log('error', err);
        return res.status(err.code || StatusCodes.INTERNAL_SERVER_ERROR)
            .json({error: {message: err.message || 'Internal server error.'}});
    }
}

