import {StatusCodes} from 'http-status-codes';
import Post from '../../models/posts/post.model';
import logger from "../../../config/winston";
import * as helper from "../../utils/helpers/errors.helper";

/**
 * @param {object} req
 * @param {object} res
 * @returns {*}
 */
export async function getPosts(req, res) {
    try {
        // let roleAuthorized = await helper.isUser(req.currentUser);
        // if (!roleAuthorized) return await helper.unauthorized(res);

        // const user = await Post.forge().where({id: req.params.id}).fetch({require: false, columns: ['id', 'email', 'username']})

        var page = parseInt(req.query.page, 10) || 1;
        var limit = parseInt(req.query.limit, 10) || 50;
        // var currentpage = page || 1;
        var order = req.query.order || "ASC";

        // const posts = await Post.forge().orderBy('id', order).limit(limit).offset(limit * (page - 1)).fetchAll();
        const posts = await Post.fetchPage({
